import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Companies from './pages/Companies';
import Dashboard from './pages/Dashboard';
import Reports from './pages/Reports';
import MondayConfig from './pages/MondayConfig';
import MondayConfigured from './pages/MondayConfigured';
import CompanyStats from './pages/CompanyStats';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/companies" element={<Companies />} />
        <Route path="/companies/:companyId/stats" element={<CompanyStats />} />
        <Route path="/statistics" element={<Dashboard />} />
        <Route path="/reports" element={<Reports />} />
        <Route path="/monday/config" element={<MondayConfig />} />
        <Route path="/monday/configured" element={<MondayConfigured />} />
        <Route path="*" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
